INXS - Disappear [promo].VOB



Very HQ rare promo music video. &quot;Disappear&quot; is a single by INXS, the second single taken from their album X. It peaked at #8 on the Billboard Hot 100, becoming the band's seventh and last top 10 single. It was a lesser hit in the UK Singles Chart, peaking at #21.

The song was written by Jon Farriss and Michael Hutchence while they were living together in Hong Kong in 1989.
